import React, { Component } from 'react';
import { Progress } from 'react-sweet-progress';
import "react-sweet-progress/lib/style.css";

class PopularityProgress extends Component{
    componentDidMount(){

        if(this.props.popularity > 80)
            this.symbol = 'ðŸ”¥'
        else if(this.props.popularity > 50)
            this.symbol = 'ðŸ˜€'
        else if(this.props.popularity > 0)
            this.symbol = 'ðŸ¤”'

        console.log(this.symbol)

    }
    render(){
        return(
            <div id='pop_progress'>
                  <div>Popularity</div>
                  <Progress percent={this.props.popularity} 
                   theme={{
                    success: {
                      symbol: 'ðŸ”¥',
                      color: '#F7630C'
                    },
                    active: {
                      symbol: this.symbol,
                      color: '#fbc630'
                    },
                    default: {
                      symbol: 'ðŸ˜±',
                      color: '#fbc630'
                    }
                  }}
                  />
            </div>
        )
    }
}

export default PopularityProgress
